      <div className="product-section-container"
      ></div>
      <div className="right">
        <h1>Maximize your selling potential</h1>
        <Para />
        <Para />
        <Para />
      </div>
      <div className="left">
        <img src={img1} />
      </div>
    </div>
  );
};

export default Sales;
